import React, {useState} from 'react';

import s from './Registration.module.css';
import AuthInput from "../AuthInput/AuthInput";
import SpaceLine from "../../SpaceLine";

const Registration = () => {
  const [login, setLogin] = useState('');
  const handleSetLogin = (event) => {
    setLogin(event.target.value);
  }
  const [password, setPassword] = useState('');
  const handleSetPassword = (event) => {
    setPassword(event.target.value);
  }

  return (
      <div className={s.reg}>
        <div className={s.reg__background}/>
        <div className={s.reg__window}>
          <div className={s.reg__content}>
            <AuthInput name={'Логин'} placeholder={'Придумайте Ваш логин'} value={login} handle={handleSetLogin}/>
            <AuthInput name={'Адрес электронной почты'} placeholder={'example@exmpl.ru'}/>
            <AuthInput name={'Номер телефона'} placeholder={'+7 (111) 222-33-44'}/>
            <SpaceLine width={300}/>
          </div>
        </div>
      </div>
  );
};

export default Registration;
